1.基础nginx代码配置

#1.创建web目录
mkdir -p /var/www/aaa/

#2.配置nginx配置文件?
/usr/local/nginx/conf/nginx.conf

#3.文件内容添加server模块
? ? ?server {
? ? ? ? listen ? ? ? 80;
? ? ? ? server_name ?www.aaa.com;
? ? ? ? root "/var/www/aaa/nginxhost/web";
? ? ? ? index index.html index.php;

? ? ? ? location / {
? ? ? ? try_files $uri $uri/ /index.php;
? ? ? ? }
? ? ? ? location ~ \.php(.*)$ {
? ? ? ? ? ? fastcgi_pass ? 127.0.0.1:9000;
? ? ? ? ? ? fastcgi_index ?index.php;
? ? ? ? ? ? fastcgi_split_path_info ?^((?U).+\.php)(/?.+)$;
? ? ? ? ? ? fastcgi_param ?SCRIPT_FILENAME ?$document_root$fastcgi_script_name;
? ? ? ? ? ? fastcgi_param ?PATH_INFO ?$fastcgi_path_info;
? ? ? ? ? ? fastcgi_param ?PATH_TRANSLATED ?$document_root$fastcgi_path_info;
? ? ? ? ? ? include ? ? ? ?fastcgi_params;
? ? ? ? }

? ? }

#4.启动nginx
[root@blackstone aaa]# /usr/local/nginx/sbin/nginx -t
nginx: the configuration file /usr/local/nginx/conf/nginx.conf syntax is ok
nginx: configuration file /usr/local/nginx/conf/nginx.conf test is successful
[root@blackstone aaa]# /usr/local/nginx/sbin/nginx

2.host绕过

Nginx在处理Host的时候，会将Host用冒号分割成hostname和port，port部分被丢弃。所以，我们可以设置Host为www.aaa.com:'"@aaa.com即可绕过。
